import React from "react";
import Button from "@mui/material/Button";

export default function Resume() {
  return (
    <div className="resume" style={{marginTop:"30px", backgroundColor:"#f8f9fa" ,marginTop:"0px", padding:"50px"}}>
      <h2 style={{margin:"0px"}}>Resume</h2>
      <div className="resume-buttons">
        <Button
          variant="outlined"
          href="#"
          style={{
            color: "#3f51b5",
            borderColor: "#3f51b5",
            borderWidth: "2px",
            marginTop: "20px",
            borderRadius: "20px",
            fontFamily: "Encode Sans Expanded",
            fontWeight: "bold",
            marginRight:"20px"
          }}
        >
          <a href="" target="_blank">View resume</a>
        </Button>
        <Button
          variant="outlined"
          href="#"
          style={{
            color: "#3f51b5",
            borderColor: "#3f51b5",
            borderWidth: "2px",
            marginTop: "20px",
            borderRadius: "20px",
            fontFamily: "Encode Sans Expanded",
            fontWeight: "bold",
          }}
        >
          <a href="" download>Download Resume<img style={{height:"20px", marginLeft}} src="/download.png"></img></a>
        </Button>
      </div>
    </div>
  );
}
